import React from 'react';
import styled from 'styled-components';

const TicketContainer = styled.div`
  width: 400px;
  height: 200px;
  padding: 30px;
  margin: 50px auto;
  background-image: url('/images/ticket-bg.jpg');
  background-size: cover;
  background-position: center;
  background-repeat: no-repeat;
  border-radius: 10px;
  color: black;
  box-shadow: 0 10px 20px rgba(0,0,0,0.2);
  position: relative;
  font-family: 'Noto Sans KR', sans-serif;
`;

const TicketHeader = styled.div`
  text-align: center;
  margin-bottom: 20px;
  color: #333;
  font-size: 14px;
  text-shadow: 1px 1px 0 white;
`;

const TicketNumber = styled.div`
  position: absolute;
  top: 20px;
  left: 20px;
  font-size: 14px;
  color: #333;
  text-shadow: 1px 1px 0 white;
`;

const TicketTitle = styled.h1`
  font-size: 28px;
  margin: 20px 0;
  text-align: center;
  color: #000;
  font-weight: bold;
  text-shadow: 1px 1px 0 white;
`;

const TicketInfo = styled.div`
  margin: 15px 0;
  font-size: 16px;
  color: #333;
  text-shadow: 1px 1px 0 white;
`;

const Price = styled.div`
  font-size: 18px;
  margin-top: 30px;
  text-align: right;
  color: #000;
  font-weight: bold;
  text-shadow: 1px 1px 0 white;
`;

const Logo = styled.div`
  width: 60px;
  height: 60px;
  background-color: #333;
  border-radius: 50%;
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 0 auto;
  font-weight: bold;
  color: white;
  font-size: 12px;
`;

function App() {
  return (
    <TicketContainer>
      <TicketNumber>No. 068</TicketNumber>
      <TicketHeader>부산댄스의 명문 라모애와 함께! Since 2004</TicketHeader>
      <Logo>식사 행운권</Logo>
      <TicketTitle>라모애클럽 정기 파티</TicketTitle>
      <TicketInfo>장소: 김해 불암동 체육관</TicketInfo>
      <TicketInfo>날짜: 2025년 1월 11일(토)</TicketInfo>
      <TicketInfo>시간: 11:30~16:30</TicketInfo>
      <Price>₩10,000</Price>
    </TicketContainer>
  );
}

export default App;
